import logo from"../logo.svg"
import {Link} from "react-router-dom"
export default class  extends Component {
    render() {
        return (
           <nav className="nav-wrapper blue ">
    <Link to="/" style={{marginLeft:50}}><img src={logo} alt="logo"  ></img></Link>
    <Link to="/" className=" hide-on-med-and-down" style={{marginLeft:300,color:"black",fon}}>Products</Link>
    <ul id="nav-mobile" className= " right hide-on-med-and-down">
       
        <li><Link to="/cart"><button className="btn">
            <i className="fas fa-cart-plus"></i>My-Cart</button></Link></li>
    </ul>
      

           </nav>
        )
    }
}
